// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import {TokenTransferProxy} from './TokenTransferProxy.sol';
import {ProxyRegistry} from './ProxyRegistry.sol';
import {ERC20} from '../dependencies/openzeppelin/contracts/token/ERC20/ERC20.sol';
import {ExchangeCore} from './ExchangeCore.sol';
import {SaleKindInterface} from './libraries/SaleKindInterface.sol';
import {DataType} from './libraries/DataType.sol';


contract ElementixExchange is ExchangeCore {
    string public constant name = "Elementix Exchange";
    string public constant version = "1.0";

    /**
     * @dev Initialize a ElementixExchange instance
     * @param registryAddress Address of the registry instance which this Exchange instance will use
     * @param tokenAddress Address of the token used for protocol fees
     */
    constructor (ProxyRegistry registryAddress, TokenTransferProxy tokenTransferProxyAddress, ERC20 tokenAddress, address protocolFeeAddress) {
        registry = registryAddress;
        tokenTransferProxy = tokenTransferProxyAddress;
        exchangeToken = tokenAddress;
        protocolFeeRecipient = protocolFeeAddress;
    }

}

